import React from "react"
import postlist from './posts.json'

const PostList = () => {
    return (
        <div className="postlist">
        {postlist.length &&
        postlist.map((post, i) => {
            return (
                <div>
                    <h2>{post.title}</h2>
                    <h2>{post.content}</h2>
                </div>
            )
        })}
        </div>
    )
}

export {PostList}
